import React from "react";
import classes from "./Categories.module.css";
import Categorie from "./categorie/Categorie";

const Categories = () => {
  return (
    <div className={classes.categories}>
      <Categorie />
      <Categorie />
      <Categorie />
    </div>
  );
};

export default Categories;
